package charanpkg;

public class dowhile3cls {
	public void disp(){
		int x=10;
		do{
			System.out.println(x);
			x++;
		}while(x<10);
		int y=10;
		while (y<10){
			System.out.println(x);
			y++;
		}
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		dowhile3cls obj=new dowhile3cls();
		obj.disp();
	}

}
